import React from 'react'
import kazak from "../logo/kazak.jpg"
import saat from "../logo/saat.jpg"
import gozluk from "../logo/gozluk.jpg"

export const SomeData = [
    {
        title:"Kazak",
        link: "/Kazak",
        icon: <img alt="" style={{height:"100px",width:"100px"}} src={kazak}></img>
    },
    {
        title:"Saat",
        link: "/Saat",
        icon: <img alt="" style={{height:"100px",width:"100px"}} src={saat}></img>
    },
    {
        title:"Gözlük",
        link: "/Gözlük",
        icon: <img alt="" style={{height:"100px",width:"100px"}} src={gozluk}></img>
    },
    {
        title:"Tisört",
        link: "/Tisört"
    },
    {
        title:"Pantalon",
        link: "/Pantalon"
    },
    {
        title:"RP",
        link: "/RP"
    },
]
